import React from "react";

import { Box } from "@material-ui/core";

const Task = ({ task, date, category }) => {
  return (
    <Box>
      {/* <h3>{task}</h3>
      <h5>{category}</h5>
      <h5>{date}</h5> */}
      <h2>wash my car</h2>
      <h4>work</h4>
      <h4>{Date.now()}</h4>
    </Box>
  );
};

export default Task;
